import React from "react";

// import images from "./data/images";

import slider2 from '../src/images/sl1.webp';
import slider1 from '../src/images/sl2.webp';
import slider3 from '../src/images/sl3.webp';
import slider4 from '../src/images/sl4.webp';

import CustomSlider from "./components/custom.slider";

import "./style.css";

const HomeSlider = () => {
const images = [
  {
    imgURL:
    slider4,
    imgAlt: slider3
  },
  {
    imgURL:
    slider2,
    imgAlt: slider1
  },
  {
    imgURL:
      "https://images.pexels.com/photos/1128678/pexels-photo-1128678.jpeg?auto=compress&cs=tinysrgb&h=750&w=1260",
    imgAlt: "img-3"
  },
  {
    imgURL:
      "https://images.pexels.com/photos/54455/cook-food-kitchen-eat-54455.jpeg?auto=compress&cs=tinysrgb&h=750&w=1260",
    imgAlt: "img-4"
  }
];


  return (
    <div className="HomeContent">
      <CustomSlider>
        {images.map((image, index) => {
          return <img key={index} src={image.imgURL} alt={image.imgAlt} className="myimages"/>;
        })}
      </CustomSlider>
    </div>
  );
}
export default HomeSlider;
